import React from 'react';

function List({ tasks }) {
  return (
    <div>
      <h2>Task List</h2>
      {/* Görevlerin liste olarak gösterimi */}
      <ul>
        {tasks.map(task => (
          <li key={task._id}>
            {task.title} - {task.status}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default List;
